(function($){

  var instaSlider = new Swiper('#insta__slider', {
    slidesPerView: 2,
    spaceBetween: 8,
    slidesPerColumn: 2,
    slidesPerColumnFill: 'row',
    watchSlidesProgress: true,
    watchOverflow: true,
    pagination: {
      el: '.insta__slider-btns .swiper-dots',
    },
    breakpoints: {
      850: {
        slidesPerView: 3,
        spaceBetween: 20,
      },
      450: {
        slidesPerView: 3,
        spaceBetween: 10,
      },
    },
  });
  var stepsNav = new Swiper('#steps__nav', {
    slidesPerView: 'auto',
    watchSlidesProgress: true,
    watchOverflow: true,
    slideToClickedSlide: true,
    breakpoints: {
      850: {
        slidesPerView: 8,
      },
    },
  });
  var stepsSlider = new Swiper('#steps__slider', {
    slidesPerView: 1,
    spaceBetween: 30,
    watchSlidesProgress: true,
    watchOverflow: true,
    thumbs: {
      swiper: stepsNav,
    }
  });
  $(".creating-steps__wrap").mCustomScrollbar({
    theme: "dark",
    scrollInertia: 1000,
  });






	$('.screen_work-process__nav .slick-dots li').click(function() {
	  	if (window.matchMedia('(max-width: 768px)').matches) {
	    	$('html, body').animate({scrollTop: $('#work-process-slider').offset().top+60+'px'});
	    }
	});


  // ПЕРЕНЕСТИ!!!!!!!
  /* Открытие / закрытие модалок (кроме карты) */
  $('a.open-modal').click(function(event){
    event.preventDefault();
    var _href = $(this).attr('href');
    if ( $(_href).length > 0 ) {
      $(_href).addClass('active');
      $(_href + ' .modal__content').addClass('visible');
    }
  });

  function closeModal() {
    var activeCount = $('.modal2.active').length;
    if ( activeCount > 1 ) {
      $($('.modal2.active')[activeCount - 1]).removeClass('active');
      $('.modal__callback2 .modal__content').removeClass('visible');
    } else {
      $('.modal2').removeClass('active');
      $('.modal__content').removeClass('visible');
    }
  }

  $(document).mouseup(function (e) {
    var container = $(".modal2 .modal__content");
    if (container.has(e.target).length === 0){
      closeModal();
    }
  });

  $('.modal2 .close').click(function(){
    closeModal();
  });

  $(document).keydown(function(eventObject){
    if( eventObject.which == 27 ){
      closeModal();
    }
  });







  // скролл до якоря
  $('.post_chief__nav > li > a').click(function(){
    var _href = $(this).attr('href');
    if (window.matchMedia('(max-width: 640px)').matches) {
    	$('html, body').animate({scrollTop: $(_href).offset().top - 80 +'px'});
    } else {
    	$('html, body').animate({scrollTop: $(_href).offset().top - 120 +'px'});
    }
    return false;
  });

  // Обернуть таблицу в статье в wrap, чтобы ограничить на мобилках
  $('.post_chief .article table').each(function(xi,xel) {
    $(this).wrap('<div class="post_chief-table-wrap"></div>');
  });

  $('.post_chief__top-left').css('height',$('.post_chief__top-left').outerHeight() + 'px');
	// фиксированная шапка
	$(document).ready(function() {
	    $(window).on("scroll", function() {
	        var fromTop = $(document).scrollTop();
	        if (!(window.matchMedia('(max-width: 700px)').matches)) {
		        $(".post_chief__top-right").toggleClass("fixed", (fromTop > 682));
		        $(".post_chief__top-right").toggleClass("wr", (fromTop > 682));
		    }
	    });
	});

	$('.post_chief__top-right .burger').click(function(){
	    $(this).toggleClass('burger--active');
	    $(this).parents('.post_chief__top-right').toggleClass('active');
	});

	// скролл к якорю mouse
    $('.post_chief .mouse').click(function(e){
    	e.preventDefault();
        var _href = $(this).attr('href');
        $('html, body').animate({scrollTop: $(_href).offset().top+'px'});
        return false;
    });


    $('a[href="#modal_part"]').click(function() {
      event.preventDefault();
      $("#modal_part").show();
      $("#modal_part .screen_form_kp").fadeIn();
      $(".page_wr").addClass("blur-it");
      $(".header").addClass("blur-it");
      $("body").addClass("lock");
    });

      function mobileSlick(xClass,xSlidesToShow) {
    $(xClass).slick({
      responsive: [
        {
          breakpoint: 4000,
          settings: "unslick"
        },
        {
          breakpoint: 500,
          settings: {
            slidesToShow: xSlidesToShow,
            slidesToScroll: 1,
            infinite: true,
            arrows: false,
            dots: true,
            appendDots: $(xClass),
            adaptiveHeight: true
          }
        }
      ]
    });
  }

  mobileSlick('body:not(.seo-page) .screen_service .items',1);

  /* Инициализация красивых select'ов */
  $('select').niceSelect();

  var casesSlider = new Swiper('#cases__slider', {
    slidesPerView: 2,
    spaceBetween: 60,
    slidesPerColumn: 2,
    slidesPerColumnFill: 'row',
    watchSlidesProgress: true,
    watchOverflow: true,
    navigation: {
      nextEl: '.cases__slider-wrap .swiper-button-next',
      prevEl: '.cases__slider-wrap .swiper-button-prev',
    },
    pagination: {
      el: '.cases__slider-wrap .swiper-dots',
    },
    breakpoints: {
      400: {
        slidesPerView: 2
      },
    },
  });

})(jQuery);
